import React, {useState} from 'react';
import logo from './logo.svg';
import AddButtonList from './components/AddButtonList'
import List from './components/List'
import listSvg from  './assets/img/list.svg'
import plusSvg from  './assets/img/add.svg'
import doIt from  './assets/img/do-it.png'
import didIt from  './assets/img/did-it.gif'

import './css/reset.css';
import './css/index.min.css';
import './css/List.min.css';

function App() {
  const [state, setState] = useState('HELLO WORLD');
  return (
    <div className="todo">
      <section className="todo__sidebar">
        <List items= {[
          { 
            icon: <img src={listSvg} alt="list icon"/>,
            name:'All tasks',
            active: true 
           }
        ]}
        isRemovable={false}/>
        <List items= {[
           {
            color: 'green',
            name:'Shoping list'
           },
           {
            color: 'green',
            name:'University'
           }
        ]}
        isRemovable/>
         <List items= {[
           {
            className: 'list__add-button',
            icon: <svg width="12" height="12" viewBox="0 0 16 16" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path d="M8 1V15" stroke="#eeeeee" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
            <path d="M1 8H15" stroke="#eeeeee" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
            </svg>
            ,
            name:'Add list'
           }
        ]}isRemovable={false}/>
      </section>
      <section className="todo__tasks">
      <img className ="shai"src={doIt} alt="list icon"/>
      </section>
    </div>
  );
}

export default App;
